-- Step 1: Start the psql server with sudo service postgresql start
-- Step 2: Run command: psql -d doggos -f init.sql

-- Seed data count:
-- dogs: 100
-- quotes: 399
-- follows: 1000
-- transactions: 1000

DROP TABLE IF EXISTS dogs;
DROP TABLE IF EXISTS quotes;
DROP TABLE IF EXISTS follows;
DROP TABLE IF EXISTS transactions;

CREATE TABLE dogs (
  id SERIAL PRIMARY KEY, 
  name TEXT,
  password TEXT,
  dob DATE,
  about TEXT,
  status INTEGER,
  bank INTEGER
);

CREATE TABLE quotes (
  id SERIAL PRIMARY KEY,
  created_at TIMESTAMPTZ NOT NULL DEFAULT NOW(),
  quote TEXT,
  quoter_id INTEGER
);

CREATE TABLE follows (
  id SERIAL PRIMARY KEY,
  followed_at TIMESTAMPTZ NOT NULL DEFAULT NOW(),
  follower_id INTEGER,
  followed_id INTEGER
);

CREATE TABLE transactions (
  id SERIAL PRIMARY KEY,
  created_at TIMESTAMPTZ NOT NULL DEFAULT NOW(),
  payer_id INTEGER,
  payee_id INTEGER,
  quote_id INTEGER,
  amount INTEGER
);




